import { GET_DIARY, DELETE_DIARY } from '../actions/types';


export const getDiary = () => {
    return {
        type: GET_DIARY
    }
}

export const deleteDiary = id => {
    return {
        type: DELETE_DIARY,
        payload: id
        }
}
